--
-- Name: clean_apprentice_duplicates(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.clean_apprentice_duplicates()
    LANGUAGE plpgsql
    AS $$
BEGIN
    DROP TABLE IF EXISTS apprentice_duplicate_map;

    CREATE TABLE apprentice_duplicate_map AS
    WITH duplicates AS (SELECT a.id,
                               a.first_name,
                               a.last_name,
                               a.birthday,
                               ROW_NUMBER() OVER (
                                   PARTITION BY a.first_name, a.last_name, a.birthday
                                   ORDER BY MAX(r.start_date) DESC NULLS LAST, a.id
                                   ) AS rank
                        FROM apprentice a
                                 LEFT JOIN registration r ON a.id = r.apprentice_id
                        GROUP BY a.id, a.first_name, a.last_name, a.birthday)
    SELECT d1.id AS id_to_delete, d2.id AS id_to_keep
    FROM duplicates d1
             JOIN duplicates d2 ON d1.first_name = d2.first_name
        AND d1.last_name = d2.last_name
        AND d1.birthday = d2.birthday
        AND d2.rank = 1
        AND d1.id <> d2.id
    WHERE d1.rank > 1;
    UPDATE registration r
    SET apprentice_id = m.id_to_keep
    FROM apprentice_duplicate_map m
    WHERE r.apprentice_id = m.id_to_delete;

    DELETE
    FROM apprentice a
        USING apprentice_duplicate_map m
    WHERE a.id = m.id_to_delete;

    DROP TABLE IF EXISTS city_duplicate_map;
END;
$$;


ALTER PROCEDURE public.clean_apprentice_duplicates() OWNER TO postgres;

--
-- Name: sp_load_dwh(); Type: PROCEDURE; Schema: public; Owner: postgres
--

CREATE PROCEDURE public.sp_load_dwh()
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_step_name VARCHAR(100);
    v_start_time TIMESTAMP;
    v_end_time TIMESTAMP;
    v_rows_affected INTEGER;
BEGIN
    -- Début de la transaction globale
    v_start_time := NOW();

    RAISE NOTICE 'Début du chargement du data warehouse à %', v_start_time;

    -- =============================================
    -- ETAPE 1 : Chargement des données de référence
    -- =============================================

    -- 1.1 Insertion des régions
    v_step_name := 'Insertion des régions';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.region;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.2 Insertion des départements
    v_step_name := 'Insertion des départements';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.department;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.3 Insertion des villes
    v_step_name := 'Insertion des villes';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.city;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.4 Insertion des codes NAF
    v_step_name := 'Insertion des codes NAF';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.naf;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.5 Insertion des OPCO
    v_step_name := 'Insertion des OPCO';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.opco;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.6 Insertion des IDCC
    v_step_name := 'Insertion des IDCC';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.idcc;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 1.7 Insertion des types d'entreprise
    v_step_name := 'Insertion des types d''entreprise';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.company_type;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 2 : Chargement des entreprises
    -- =============================================

    v_step_name := 'Insertion des entreprises';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT id,
           siret,
           name,
           city_id,
           idcc_id,
           naf_id,
           category,
           type_id
    FROM staging.company_info;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 3 : Chargement des apprentis
    -- =============================================

    v_step_name := 'Insertion des apprentis';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    WITH situation_before AS (
        SELECT DISTINCT cerfa_param.*
        FROM staging.apprentice
        LEFT JOIN staging.cerfa_param ON situation_before_id = cerfa_param.id
    ),
    last_degree_prepared_category AS (
        SELECT DISTINCT cerfa_param.*
        FROM staging.apprentice
        LEFT JOIN staging.cerfa_param ON last_degree_prepared_category_id = cerfa_param.id
    ),
    last_degree_obtained_category AS (
        SELECT DISTINCT cerfa_param.*
        FROM staging.apprentice
        LEFT JOIN staging.cerfa_param ON last_degree_obtained_category_id = cerfa_param.id
    )
    SELECT a.id,
           address_city_id AS city_id,
           situation_before.name AS situation_before,
           last_degree_prepared_category.name AS last_degree_prepared_category,
           last_degree_obtained_category.name AS last_degree_obtained_category,
           CASE
               WHEN gender = 1 THEN 'M'
               WHEN gender = 2 THEN 'F'
           END AS gender,
           first_name,
           last_name,
           birthday,
           CASE
               WHEN nationality = 1 THEN 'Française'
               WHEN nationality = 2 THEN 'Union Européenne'
               WHEN nationality = 3 THEN 'Etranger hors Union Européenne'
           END AS nationality,
           CASE
               WHEN has_handicap = 1 THEN true
               WHEN has_handicap = 0 THEN false
           END AS has_handicap,
           athlete,
           is_apprenticeship_last_year,
           status_apprentice
    FROM staging.apprentice a
    LEFT JOIN situation_before ON situation_before_id = situation_before.id
    LEFT JOIN last_degree_prepared_category ON last_degree_prepared_category_id = last_degree_prepared_category.id
    LEFT JOIN last_degree_obtained_category ON last_degree_obtained_category_id = last_degree_obtained_category.id;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 4 : Chargement des établissements de formation
    -- =============================================

    -- 4.1 Insertion des institutions
    v_step_name := 'Insertion des institutions';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.institution;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- 4.2 Insertion des composantes
    v_step_name := 'Insertion des composantes';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT *
    FROM staging.component;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 5 : Chargement des formations
    -- =============================================

    v_step_name := 'Insertion des formations';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT training.id,
           institution_id,
           component_id,
           d.name AS type,
           s.name AS sector,
           training.name AS training_name,
           acronym,
           duration_total,
           fc_cost,
           accessibilty,
           cnfpt_cost,
           dl.code AS level
    FROM staging.training
    LEFT JOIN staging.degree d ON training.degree_id = d.id
    LEFT JOIN staging.degree_level dl ON d.degree_level_id = dl.id
    LEFT JOIN staging.sector s ON training.sector_id = s.id;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 6 : Chargement des années scolaires
    -- =============================================

    v_step_name := 'Insertion des années scolaires';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT id,
           training_id,
           start_year,
           end_year,
           month_duration,
           name,
           complement_name,
           acronym
    FROM staging.training_course;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 7 : Chargement des groupes de formation
    -- =============================================

    v_step_name := 'Insertion des groupes de formation';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT id,
           course_id AS school_year_id,
           title,
           start_year,
           end_year,
           month_duration
    FROM staging.training_group;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 8 : Chargement des options de formation
    -- =============================================

    v_step_name := 'Insertion des options de formation';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT id,
           group_id AS training_group_id,
           title,
           mobility_international
    FROM staging.training_option;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 9 : Chargement des inscriptions
    -- =============================================

    v_step_name := 'Insertion des inscriptions';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT id,
           apprentice_id,
           host_company_id AS company_id,
           option_id,
           start_date,
           end_date,
           step,
           last_updated_at,
           status
    FROM staging.registration;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 10 : Chargement des contrats
    -- =============================================

    v_step_name := 'Insertion des contrats';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT row_number() OVER () AS id,
           r.id AS registration_id,
           r.apprentice_id,
           host_company_id AS company_id,
           r.option_id,
           r.start_date,
           r.end_date,
           r.last_updated_at,
           r.status,
           r.signature_date,
           r.avenant_date,
           o.id AS opco_id,
           r.internal_contract_number_year,
           r.code_cnfpt,
           r.has_negotiated_cost,
           r.negotiated_cost,
           r.valid_negotiated_cost,
           r.convention_send_date,
           r.billing_start_date,
           r.billing_end_date,
           r.resignation_date,
           r.opco_supported,
           r.apec_amount_total,
           r.status_financial,
           c.id AS contract_parent_id,
           r.has_amendment,
           CASE
               WHEN r.status IN ('rupture',
                                'rupture_pending',
                                'rupture_partielle',
                                'abandon') THEN true
               ELSE false
           END AS has_breach
    FROM staging.registration r
    LEFT JOIN staging.opco_address oa ON oa.id = r.opco_address_id
    LEFT JOIN staging.opco o ON o.id = oa.opco_id
    LEFT JOIN dwh.contract c ON r.registration_parent_id = c.registration_id
    WHERE r.status IN ('rupture',
                      'rupture_pending',
                      'rupture_partielle',
                      'abandon',
                      'double',
                      'cfa_validated')
    ORDER BY r.created_at;

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- ETAPE 11 : Chargement des ruptures de contrat
    -- =============================================

    v_step_name := 'Insertion des ruptures de contrat';
    RAISE NOTICE 'Etape en cours : %', v_step_name;

    SELECT row_number() OVER () AS id,
           c.id AS contract_id,
           c.status,
           contract_breach_date AS breach_date,
           CASE
               WHEN contract_breach_type = 1 THEN 'Période essai'
               WHEN contract_breach_type = 2 THEN 'Commun accord'
               WHEN contract_breach_type = 3 THEN 'Obtention Diplôme'
               WHEN contract_breach_type = 4 THEN 'Licenciement pour faute'
               WHEN contract_breach_type = 5 THEN 'Rupture par décision administrative'
               WHEN contract_breach_type = 6 THEN 'Liquidation judiciaire'
               WHEN contract_breach_type = 7 THEN 'Autre'
           END AS breach_type,
           contract_breach_comment AS breach_comment,
           contract_breach_status AS breach_status,
           contract_breach_training_dropped AS training_dropped,
           c.resignation_date,
           CASE
               WHEN contract_breach_initiative = 1 THEN 'Alternant'
               WHEN contract_breach_initiative = 2 THEN 'Entreprise'
               WHEN contract_breach_initiative = 3 THEN 'Les deux'
           END AS breach_initiative,
           CASE
               WHEN contract_breach_leave_training = 1 THEN 'Réorientation sur un autre parcours'
               WHEN contract_breach_leave_training = 4 THEN 'Finalisation hors contrat d''alternance '
               WHEN contract_breach_leave_training = 2 THEN 'Autre'
           END AS leave_training,
           CASE
               WHEN contract_breach_pattern = 1 THEN 'En recherche d''un nouveau contrat'
               WHEN contract_breach_pattern = 2 THEN 'Nouveau contrat en cours de signature'
               WHEN contract_breach_pattern = 3 THEN 'Obtention du diplôme'
               WHEN contract_breach_pattern = 5 THEN 'Décision en attente'
               WHEN contract_breach_pattern = 6 THEN 'Nouveau contrat signé'
           END AS breach_pattern,
           contract_breach_comment_company AS breach_comment_company,
           status_before_breach,
           status_contract_before_breach,
           breach_declaration_at,
           breach_validation_at
    FROM staging.registration r
    LEFT JOIN staging.opco_address oa ON oa.id = r.opco_address_id
    LEFT JOIN staging.opco o ON o.id = oa.opco_id
    LEFT JOIN dwh.contract AS c ON c.registration_id = r.id
    WHERE c.status IN ('rupture',
                      'rupture_pending',
                      'rupture_partielle',
                      'abandon');

    GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
    RAISE NOTICE '% - % lignes insérées', v_step_name, v_rows_affected;

    -- =============================================
    -- FIN DE LA PROCEDURE
    -- =============================================

    v_end_time := NOW();

    RAISE NOTICE 'Chargement du data warehouse terminé avec succès à %', v_end_time;
    RAISE NOTICE 'Durée totale d''exécution : %', v_end_time - v_start_time;

EXCEPTION
    WHEN OTHERS THEN
        -- Gestion des erreurs
        RAISE EXCEPTION 'Erreur lors de l''étape "%" : % (SQLSTATE: %)',
                       v_step_name, SQLERRM, SQLSTATE;
        ROLLBACK;
END;
$$;


ALTER PROCEDURE public.sp_load_dwh() OWNER TO postgres;

--
-- Name: check_foreign_keys(text); Type: FUNCTION; Schema: staging; Owner: postgres
--

CREATE FUNCTION staging.check_foreign_keys(schema_name text DEFAULT 'staging'::text) RETURNS TABLE(message text)
    LANGUAGE plpgsql
    AS $_$
DECLARE
    r RECORD;
    sql TEXT;
    orphan_count INTEGER;
    schema_exists BOOLEAN;
BEGIN
    SELECT EXISTS (
        SELECT 1 FROM information_schema.schemata WHERE schema_name = $1
    ) INTO schema_exists;

    IF NOT schema_exists THEN
        message := format('Schema "%s" does not exist', schema_name);
        RETURN NEXT;
        RETURN;
    END IF;

    FOR r IN
        SELECT
            tc.table_name,
            kcu.column_name,
            ccu.table_name AS foreign_table,
            ccu.column_name AS foreign_column
        FROM information_schema.table_constraints tc
        JOIN information_schema.key_column_usage kcu
            ON tc.constraint_name = kcu.constraint_name
            AND tc.table_schema = kcu.table_schema
        JOIN information_schema.constraint_column_usage ccu
            ON tc.constraint_name = ccu.constraint_name
            AND tc.table_schema = ccu.table_schema
        WHERE tc.constraint_type = 'FOREIGN KEY'
          AND tc.table_schema = schema_name
    LOOP
        sql := format($q$
            SELECT COUNT(*) FROM %I.%I t
            LEFT JOIN %I.%I f ON t.%I = f.%I
            WHERE t.%I IS NOT NULL AND f.%I IS NULL
        $q$, schema_name, r.table_name, schema_name, r.foreign_table,
             r.column_name, r.foreign_column, r.column_name, r.foreign_column);

        EXECUTE sql INTO orphan_count;

        IF orphan_count > 0 THEN
            message := format(
                '%s FK orphelines: %s.%s ÔåÆ %s.%s (%s lignes)',
                orphan_count,
                r.table_name, r.column_name,
                r.foreign_table, r.foreign_column,
                orphan_count
            );
            RETURN NEXT;
        END IF;
    END LOOP;
END;
$_$;


ALTER FUNCTION staging.check_foreign_keys(schema_name text) OWNER TO postgres;

--
-- Name: clean_apprentice_duplicates(); Type: PROCEDURE; Schema: staging; Owner: postgres
--

CREATE PROCEDURE staging.clean_apprentice_duplicates()
    LANGUAGE plpgsql
    AS $$
BEGIN
    DROP TABLE IF EXISTS apprentice_duplicate_map;

    CREATE TABLE apprentice_duplicate_map AS
    WITH duplicates AS (SELECT a.id,
                               a.first_name,
                               a.last_name,
                               a.birthday,
                               ROW_NUMBER() OVER (
                                   PARTITION BY a.first_name, a.last_name, a.birthday
                                   ORDER BY MAX(r.start_date) DESC NULLS LAST, a.id
                                   ) AS rank
                        FROM apprentice a
                                 LEFT JOIN registration r ON a.id = r.apprentice_id
                        GROUP BY a.id, a.first_name, a.last_name, a.birthday)
    SELECT d1.id AS id_to_delete, d2.id AS id_to_keep
    FROM duplicates d1
             JOIN duplicates d2 ON d1.first_name = d2.first_name
        AND d1.last_name = d2.last_name
        AND d1.birthday = d2.birthday
        AND d2.rank = 1
        AND d1.id <> d2.id
    WHERE d1.rank > 1;
    UPDATE registration r
    SET apprentice_id = m.id_to_keep
    FROM apprentice_duplicate_map m
    WHERE r.apprentice_id = m.id_to_delete;

    DELETE
    FROM apprentice a
        USING apprentice_duplicate_map m
    WHERE a.id = m.id_to_delete;

    DROP TABLE IF EXISTS city_duplicate_map;
END;
$$;


ALTER PROCEDURE staging.clean_apprentice_duplicates() OWNER TO postgres;

--
-- Name: clean_city_duplicates(); Type: PROCEDURE; Schema: staging; Owner: postgres
--

CREATE PROCEDURE staging.clean_city_duplicates()
    LANGUAGE plpgsql
    AS $$
BEGIN
    DROP TABLE IF EXISTS city_duplicate_map;

    CREATE TABLE city_duplicate_map AS
    WITH duplicates AS (
        SELECT id,
               code,
               name,
               department_id,
               latitude,
               longitude,
               ROW_NUMBER() OVER (
                   PARTITION BY code, name, department_id, latitude, longitude
               ) AS rank
        FROM city
    )
    SELECT d1.id AS id_to_delete, d2.id AS id_to_keep
    FROM duplicates d1
             JOIN duplicates d2 ON d1.code = d2.code AND d2.rank = 1
    WHERE d1.rank > 1;

    UPDATE apprentice a
    SET address_city_id = m.id_to_keep
    FROM city_duplicate_map m
    WHERE a.address_city_id = m.id_to_delete;

    UPDATE company_info a
    SET city_id = m.id_to_keep
    FROM city_duplicate_map m
    WHERE a.city_id = m.id_to_delete;

    DELETE
    FROM city c
        USING city_duplicate_map m
    WHERE c.id = m.id_to_delete;

    DROP TABLE IF EXISTS city_duplicate_map;
END;
$$;


ALTER PROCEDURE staging.clean_city_duplicates() OWNER TO postgres;

