--
-- Name: proc_insert_dwh(); Type: PROCEDURE; Schema: staging; Owner: postgres
--

CREATE PROCEDURE staging.proc_insert_dwh()
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_start_time timestamp;
    v_end_time timestamp;
    v_duration interval;
    v_rows_affected integer;
    v_total_rows integer := 0;
    v_error_message text;
BEGIN
    -- Enregistrement du début de l'exécution
    v_start_time := clock_timestamp();

    RAISE NOTICE 'Début de la procédure d''insertion DWH à %', v_start_time;

    BEGIN
        -- Les procédures PostgreSQL s'exécutent déjà dans une transaction
        -- Pas besoin de START TRANSACTION explicite

        -- =====================================================
        -- 1. TABLES DE REFERENCE (pas de dépendances)
        -- =====================================================

        RAISE NOTICE 'Insertion des tables de référence...';

        -- Insertion région
        SELECT *
        FROM staging.region
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            name = EXCLUDED.name
        WHERE dwh.region.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.region.name IS DISTINCT FROM EXCLUDED.name;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Régions insérées/mises à jour: %', v_rows_affected;

        -- Insertion département
        SELECT *
        FROM staging.department
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            name = EXCLUDED.name,
            region_id = EXCLUDED.region_id
        WHERE dwh.department.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.department.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.department.region_id IS DISTINCT FROM EXCLUDED.region_id;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Départements insérés/mis à jour: %', v_rows_affected;

        -- Insertion ville
        SELECT *
        FROM staging.city
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            name = EXCLUDED.name,
            department_id = EXCLUDED.department_id,
            latitude = EXCLUDED.latitude,
            longitude = EXCLUDED.longitude
        WHERE dwh.city.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.city.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.city.department_id IS DISTINCT FROM EXCLUDED.department_id
           OR dwh.city.latitude IS DISTINCT FROM EXCLUDED.latitude
           OR dwh.city.longitude IS DISTINCT FROM EXCLUDED.longitude;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Villes insérées/mises à jour: %', v_rows_affected;

        -- Insertion NAF
        SELECT *
        FROM staging.naf
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            sous_classes = EXCLUDED.sous_classes,
            classes = EXCLUDED.classes,
            groupes = EXCLUDED.groupes,
            divisions = EXCLUDED.divisions,
            sections = EXCLUDED.sections
        WHERE dwh.naf.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.naf.sous_classes IS DISTINCT FROM EXCLUDED.sous_classes
           OR dwh.naf.classes IS DISTINCT FROM EXCLUDED.classes
           OR dwh.naf.groupes IS DISTINCT FROM EXCLUDED.groupes
           OR dwh.naf.divisions IS DISTINCT FROM EXCLUDED.divisions
           OR dwh.naf.sections IS DISTINCT FROM EXCLUDED.sections;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Codes NAF insérés/mis à jour: %', v_rows_affected;

        -- Insertion OPCO
        SELECT *
        FROM staging.opco
        ON CONFLICT (id) DO UPDATE
        SET name = EXCLUDED.name
        WHERE dwh.opco.name IS DISTINCT FROM EXCLUDED.name;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'OPCO insérés/mis à jour: %', v_rows_affected;

        -- Insertion IDCC
        SELECT *
        FROM staging.idcc
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            name = EXCLUDED.name
        WHERE dwh.idcc.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.idcc.name IS DISTINCT FROM EXCLUDED.name;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'IDCC insérés/mis à jour: %', v_rows_affected;

        -- Insertion type d'entreprise
        SELECT *
        FROM staging.company_type
        ON CONFLICT (id) DO UPDATE
        SET name = EXCLUDED.name
        WHERE dwh.company_type.name IS DISTINCT FROM EXCLUDED.name;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Types d''entreprise insérés/mis à jour: %', v_rows_affected;

        -- Insertion institution (doit être avant component car component dépend de institution)
        SELECT id,
               code,
               name,
               CASE
                   WHEN name = 'Athalia' THEN 600
                   ELSE 400
               END AS management_cost,
               updated_at
        FROM staging.institution
        ON CONFLICT (id) DO UPDATE
        SET code = EXCLUDED.code,
            name = EXCLUDED.name,
            management_cost = EXCLUDED.management_cost,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.institution.code IS DISTINCT FROM EXCLUDED.code
           OR dwh.institution.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.institution.management_cost IS DISTINCT FROM EXCLUDED.management_cost
           OR dwh.institution.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Institutions insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- 2. TABLES AVEC DEPENDANCES NIVEAU 1
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 1...';

        -- Insertion composant (dépend de institution)
        SELECT *
        FROM staging.component
        ON CONFLICT (id) DO UPDATE
        SET name = EXCLUDED.name,
            institution_id = EXCLUDED.institution_id
        WHERE dwh.component.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.component.institution_id IS DISTINCT FROM EXCLUDED.institution_id;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Composants insérés/mis à jour: %', v_rows_affected;

        -- Insertion entreprise (dépend de city, idcc, naf, company_type)
        SELECT id,
               siret,
               name,
               city_id,
               idcc_id,
               naf_id,
               category,
               type_id,
               updated_at
        FROM staging.company_info
        ON CONFLICT (id) DO UPDATE
        SET siret = EXCLUDED.siret,
            name = EXCLUDED.name,
            city_id = EXCLUDED.city_id,
            idcc_id = EXCLUDED.idcc_id,
            naf_id = EXCLUDED.naf_id,
            category = EXCLUDED.category,
            type_id = EXCLUDED.type_id,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.company.siret IS DISTINCT FROM EXCLUDED.siret
           OR dwh.company.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.company.city_id IS DISTINCT FROM EXCLUDED.city_id
           OR dwh.company.idcc_id IS DISTINCT FROM EXCLUDED.idcc_id
           OR dwh.company.naf_id IS DISTINCT FROM EXCLUDED.naf_id
           OR dwh.company.category IS DISTINCT FROM EXCLUDED.category
           OR dwh.company.type_id IS DISTINCT FROM EXCLUDED.type_id;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Entreprises insérées/mises à jour: %', v_rows_affected;

        -- Insertion apprenti (dépend de city)
        WITH situation_before AS (
            SELECT DISTINCT cerfa_param.*
            FROM staging.apprentice
            LEFT JOIN staging.cerfa_param ON situation_before_id = cerfa_param.id
        ),
        last_degree_prepared_category AS (
            SELECT DISTINCT cerfa_param.*
            FROM staging.apprentice
            LEFT JOIN staging.cerfa_param ON last_degree_prepared_category_id = cerfa_param.id
        ),
        last_degree_obtained_category AS (
            SELECT DISTINCT cerfa_param.*
            FROM staging.apprentice
            LEFT JOIN staging.cerfa_param ON last_degree_obtained_category_id = cerfa_param.id
        )
        SELECT a.id,
               address_city_id AS city_id,
               situation_before.name AS situation_before,
               last_degree_prepared_category.name AS last_degree_prepared_category,
               last_degree_obtained_category.name AS last_degree_obtained_category,
               CASE
                   WHEN gender = 1 THEN 'M'
                   WHEN gender = 2 THEN 'F'
               END AS gender,
               first_name,
               last_name,
               birthday,
               CASE
                   WHEN nationality = 1 THEN 'Française'
                   WHEN nationality = 2 THEN 'Union Européenne'
                   WHEN nationality = 3 THEN 'Etranger hors Union Européenne'
               END AS nationality,
               CASE
                   WHEN has_handicap = 1 THEN true
                   WHEN has_handicap = 0 THEN false
               END AS has_handicap,
               athlete,
               is_apprenticeship_last_year,
               status_apprentice,
               has_educational_facility,
               updated_at
        FROM staging.apprentice a
        LEFT JOIN situation_before ON situation_before_id = situation_before.id
        LEFT JOIN last_degree_prepared_category ON last_degree_prepared_category_id = last_degree_prepared_category.id
        LEFT JOIN last_degree_obtained_category ON last_degree_obtained_category_id = last_degree_obtained_category.id
        ON CONFLICT (id) DO UPDATE
        SET city_id = EXCLUDED.city_id,
            situation_before = EXCLUDED.situation_before,
            last_degree_prepared_category = EXCLUDED.last_degree_prepared_category,
            last_degree_obtained_category = EXCLUDED.last_degree_obtained_category,
            gender = EXCLUDED.gender,
            first_name = EXCLUDED.first_name,
            last_name = EXCLUDED.last_name,
            birthday = EXCLUDED.birthday,
            nationality = EXCLUDED.nationality,
            has_handicap = EXCLUDED.has_handicap,
            athlete = EXCLUDED.athlete,
            is_apprenticeship_last_year = EXCLUDED.is_apprenticeship_last_year,
            status_apprentice = EXCLUDED.status_apprentice,
            has_educational_facility = EXCLUDED.has_educational_facility,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.apprentice.city_id IS DISTINCT FROM EXCLUDED.city_id
           OR dwh.apprentice.situation_before IS DISTINCT FROM EXCLUDED.situation_before
           OR dwh.apprentice.last_degree_prepared_category IS DISTINCT FROM EXCLUDED.last_degree_prepared_category
           OR dwh.apprentice.last_degree_obtained_category IS DISTINCT FROM EXCLUDED.last_degree_obtained_category
           OR dwh.apprentice.gender IS DISTINCT FROM EXCLUDED.gender
           OR dwh.apprentice.first_name IS DISTINCT FROM EXCLUDED.first_name
           OR dwh.apprentice.last_name IS DISTINCT FROM EXCLUDED.last_name
           OR dwh.apprentice.birthday IS DISTINCT FROM EXCLUDED.birthday
           OR dwh.apprentice.nationality IS DISTINCT FROM EXCLUDED.nationality
           OR dwh.apprentice.has_handicap IS DISTINCT FROM EXCLUDED.has_handicap
           OR dwh.apprentice.athlete IS DISTINCT FROM EXCLUDED.athlete
           OR dwh.apprentice.is_apprenticeship_last_year IS DISTINCT FROM EXCLUDED.is_apprenticeship_last_year
           OR dwh.apprentice.status_apprentice IS DISTINCT FROM EXCLUDED.status_apprentice
           OR dwh.apprentice.has_educational_facility IS DISTINCT FROM EXCLUDED.has_educational_facility
           OR dwh.apprentice.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Apprentis insérés/mis à jour: %', v_rows_affected;

        -- =====================================================
        -- 2. TABLES AVEC DEPENDANCES NIVEAU 2
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 2...';

        -- Insertion formation (dépend de institution, component)
        SELECT training.id,
               institution_id,
               component_id,
               d.name AS type,
               s.name AS sector,
               training.name AS training_name,
               acronym,
               duration_total,
               fc_cost,
               accessibilty,
               cnfpt_cost,
               dl.code AS level,
               training.updated_at
        FROM staging.training
        LEFT JOIN staging.degree d ON training.degree_id = d.id
        LEFT JOIN staging.degree_level dl ON d.degree_level_id = dl.id
        LEFT JOIN staging.sector s ON training.sector_id = s.id
        ON CONFLICT (id) DO UPDATE
        SET institution_id = EXCLUDED.institution_id,
            component_id = EXCLUDED.component_id,
            type = EXCLUDED.type,
            sector = EXCLUDED.sector,
            training_name = EXCLUDED.training_name,
            acronym = EXCLUDED.acronym,
            duration_total = EXCLUDED.duration_total,
            fc_cost = EXCLUDED.fc_cost,
            accessibilty = EXCLUDED.accessibilty,
            cnfpt_cost = EXCLUDED.cnfpt_cost,
            level = EXCLUDED.level,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.training.institution_id IS DISTINCT FROM EXCLUDED.institution_id
           OR dwh.training.component_id IS DISTINCT FROM EXCLUDED.component_id
           OR dwh.training.type IS DISTINCT FROM EXCLUDED.type
           OR dwh.training.sector IS DISTINCT FROM EXCLUDED.sector
           OR dwh.training.training_name IS DISTINCT FROM EXCLUDED.training_name
           OR dwh.training.acronym IS DISTINCT FROM EXCLUDED.acronym
           OR dwh.training.duration_total IS DISTINCT FROM EXCLUDED.duration_total
           OR dwh.training.fc_cost IS DISTINCT FROM EXCLUDED.fc_cost
           OR dwh.training.accessibilty IS DISTINCT FROM EXCLUDED.accessibilty
           OR dwh.training.cnfpt_cost IS DISTINCT FROM EXCLUDED.cnfpt_cost
           OR dwh.training.level IS DISTINCT FROM EXCLUDED.level
           OR dwh.training.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Formations insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- 3. TABLES AVEC DEPENDANCES NIVEAU 3
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 3...';

        -- Insertion année scolaire (dépend de training)
        SELECT id,
               training_id,
               start_year,
               end_year,
               month_duration,
               name,
               complement_name,
               acronym,
               updated_at
        FROM staging.training_course
        ON CONFLICT (id) DO UPDATE
        SET training_id = EXCLUDED.training_id,
            start_year = EXCLUDED.start_year,
            end_year = EXCLUDED.end_year,
            month_duration = EXCLUDED.month_duration,
            name = EXCLUDED.name,
            complement_name = EXCLUDED.complement_name,
            acronym = EXCLUDED.acronym,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.school_year.training_id IS DISTINCT FROM EXCLUDED.training_id
           OR dwh.school_year.start_year IS DISTINCT FROM EXCLUDED.start_year
           OR dwh.school_year.end_year IS DISTINCT FROM EXCLUDED.end_year
           OR dwh.school_year.month_duration IS DISTINCT FROM EXCLUDED.month_duration
           OR dwh.school_year.name IS DISTINCT FROM EXCLUDED.name
           OR dwh.school_year.complement_name IS DISTINCT FROM EXCLUDED.complement_name
           OR dwh.school_year.acronym IS DISTINCT FROM EXCLUDED.acronym
           OR dwh.school_year.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Années scolaires insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- 4. TABLES AVEC DEPENDANCES NIVEAU 4
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 4...';

        -- Insertion groupe de formation (dépend de school_year)
        SELECT id,
               course_id AS school_year_id,
               title,
               start_year,
               end_year,
               month_duration,
               updated_at
        FROM staging.training_group
        ON CONFLICT (id) DO UPDATE
        SET school_year_id = EXCLUDED.school_year_id,
            title = EXCLUDED.title,
            start_year = EXCLUDED.start_year,
            end_year = EXCLUDED.end_year,
            month_duration = EXCLUDED.month_duration,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.training_group.school_year_id IS DISTINCT FROM EXCLUDED.school_year_id
           OR dwh.training_group.title IS DISTINCT FROM EXCLUDED.title
           OR dwh.training_group.start_year IS DISTINCT FROM EXCLUDED.start_year
           OR dwh.training_group.end_year IS DISTINCT FROM EXCLUDED.end_year
           OR dwh.training_group.month_duration IS DISTINCT FROM EXCLUDED.month_duration
           OR dwh.training_group.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Groupes de formation insérés/mis à jour: %', v_rows_affected;

        -- =====================================================
        -- 5. TABLES AVEC DEPENDANCES NIVEAU 5
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 5...';

        -- Insertion option de formation (dépend de training_group)
        SELECT id,
               group_id AS training_group_id,
               title,
               mobility_international,
               updated_at
        FROM staging.training_option
        ON CONFLICT (id) DO UPDATE
        SET training_group_id = EXCLUDED.training_group_id,
            title = EXCLUDED.title,
            mobility_international = EXCLUDED.mobility_international,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.training_option.training_group_id IS DISTINCT FROM EXCLUDED.training_group_id
           OR dwh.training_option.title IS DISTINCT FROM EXCLUDED.title
           OR dwh.training_option.mobility_international IS DISTINCT FROM EXCLUDED.mobility_international
           OR dwh.training_option.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Options de formation insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- 6. TABLES AVEC DEPENDANCES NIVEAU 6
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 6...';

        -- Insertion inscription (dépend de apprentice, company, training_option)
        SELECT id,
               apprentice_id,
               host_company_id AS company_id,
               option_id,
               start_date,
               end_date,
               step,
               last_updated_at,
               status,
               updated_at
        FROM staging.registration
        ON CONFLICT (id) DO UPDATE
        SET apprentice_id = EXCLUDED.apprentice_id,
            company_id = EXCLUDED.company_id,
            option_id = EXCLUDED.option_id,
            start_date = EXCLUDED.start_date,
            end_date = EXCLUDED.end_date,
            step = EXCLUDED.step,
            last_updated_at = EXCLUDED.last_updated_at,
            status = EXCLUDED.status,
            updated_at = EXCLUDED.updated_at
        WHERE dwh.registration.apprentice_id IS DISTINCT FROM EXCLUDED.apprentice_id
           OR dwh.registration.company_id IS DISTINCT FROM EXCLUDED.company_id
           OR dwh.registration.option_id IS DISTINCT FROM EXCLUDED.option_id
           OR dwh.registration.start_date IS DISTINCT FROM EXCLUDED.start_date
           OR dwh.registration.end_date IS DISTINCT FROM EXCLUDED.end_date
           OR dwh.registration.step IS DISTINCT FROM EXCLUDED.step
           OR dwh.registration.last_updated_at IS DISTINCT FROM EXCLUDED.last_updated_at
           OR dwh.registration.status IS DISTINCT FROM EXCLUDED.status
           OR dwh.registration.updated_at IS DISTINCT FROM EXCLUDED.updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Inscriptions insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- 7. TABLES AVEC DEPENDANCES NIVEAU 7
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 7...';

        -- Insertion contrat (dépend de registration, opco)
        -- Utilisation de l'ID de registration comme clé primaire pour le contrat
        -- Cette approche permet d'éviter le DELETE complet et utilise ON CONFLICT comme les autres tables
        RAISE NOTICE 'Insertion des contrats...';
        SELECT r.id AS id, -- Utilisation de l'ID de registration comme clé primaire
               r.id AS registration_id,
               r.apprentice_id,
               host_company_id AS company_id,
               r.option_id,
               r.start_date,
               r.end_date,
               r.last_updated_at,
               r.status,
               r.signature_date,
               r.avenant_date,
               o.id AS opco_id,
               r.internal_contract_number_year,
               r.code_cnfpt,
               r.has_negotiated_cost,
               r.negotiated_cost,
               r.valid_negotiated_cost,
               r.convention_send_date,
               r.billing_start_date,
               r.billing_end_date,
               r.resignation_date,
               r.opco_supported,
               r.apec_amount_total,
               r.status_financial,
               c.id AS contract_parent_id,
               r.has_amendment,
               CASE
                   WHEN r.status IN ('rupture',
                                   'rupture_pending',
                                   'rupture_partielle',
                                   'abandon') THEN true
                   ELSE false
               END AS has_breach
        FROM staging.registration r
        LEFT JOIN staging.opco_address oa ON oa.id = r.opco_address_id
        LEFT JOIN staging.opco o ON o.id = oa.opco_id
        LEFT JOIN dwh.contract c ON r.registration_parent_id = c.registration_id
        WHERE r.status IN ('rupture',
                         'rupture_pending',
                         'rupture_partielle',
                         'abandon',
                         'double',
                         'cfa_validated')
        ORDER BY r.created_at
        ON CONFLICT (id) DO UPDATE
        SET registration_id = EXCLUDED.registration_id,
            apprentice_id = EXCLUDED.apprentice_id,
            company_id = EXCLUDED.company_id,
            option_id = EXCLUDED.option_id,
            start_date = EXCLUDED.start_date,
            end_date = EXCLUDED.end_date,
            last_updated_at = EXCLUDED.last_updated_at,
            status = EXCLUDED.status,
            signature_date = EXCLUDED.signature_date,
            avenant_date = EXCLUDED.avenant_date,
            opco_id = EXCLUDED.opco_id,
            internal_contract_number_year = EXCLUDED.internal_contract_number_year,
            code_cnfpt = EXCLUDED.code_cnfpt,
            has_negotiated_cost = EXCLUDED.has_negotiated_cost,
            negotiated_cost = EXCLUDED.negotiated_cost,
            valid_negotiated_cost = EXCLUDED.valid_negotiated_cost,
            convention_send_date = EXCLUDED.convention_send_date,
            billing_start_date = EXCLUDED.billing_start_date,
            billing_end_date = EXCLUDED.billing_end_date,
            resignation_date = EXCLUDED.resignation_date,
            opco_supported = EXCLUDED.opco_supported,
            apec_amount_total = EXCLUDED.apec_amount_total,
            status_financial = EXCLUDED.status_financial,
            contract_parent_id = EXCLUDED.contract_parent_id,
            has_amendment = EXCLUDED.has_amendment,
            has_breach = EXCLUDED.has_breach
        WHERE dwh.contract.apprentice_id IS DISTINCT FROM EXCLUDED.apprentice_id
           OR dwh.contract.company_id IS DISTINCT FROM EXCLUDED.company_id
           OR dwh.contract.option_id IS DISTINCT FROM EXCLUDED.option_id
           OR dwh.contract.start_date IS DISTINCT FROM EXCLUDED.start_date
           OR dwh.contract.end_date IS DISTINCT FROM EXCLUDED.end_date
           OR dwh.contract.status IS DISTINCT FROM EXCLUDED.status
           OR dwh.contract.last_updated_at IS DISTINCT FROM EXCLUDED.last_updated_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Contrats insérés/mis à jour: %', v_rows_affected;

        -- =====================================================
        -- 8. TABLES AVEC DEPENDANCES NIVEAU 8
        -- =====================================================

        RAISE NOTICE 'Insertion des tables avec dépendances niveau 8...';

        -- Insertion rupture (dépend de contract)
        -- Utilisation de l'ID de contract comme clé primaire pour la rupture
        -- Cette approche permet d'éviter le DELETE complet et utilise ON CONFLICT comme les autres tables
        RAISE NOTICE 'Insertion des ruptures...';
        SELECT c.id AS id, -- Utilisation de l'ID de contrat comme clé primaire
               c.id AS contract_id,
               c.status,
               contract_breach_date AS breach_date,
               CASE
                   WHEN contract_breach_type = 1 THEN 'Période essai'
                   WHEN contract_breach_type = 2 THEN 'Commun accord'
                   WHEN contract_breach_type = 3 THEN 'Obtention Diplôme'
                   WHEN contract_breach_type = 4 THEN 'Licenciement pour faute'
                   WHEN contract_breach_type = 5 THEN 'Rupture par décision administrative'
                   WHEN contract_breach_type = 6 THEN 'Liquidation judiciaire'
                   WHEN contract_breach_type = 7 THEN 'Autre'
               END AS breach_type,
               contract_breach_comment AS breach_comment,
               contract_breach_status AS breach_status,
               contract_breach_training_dropped AS training_dropped,
               c.resignation_date,
               CASE
                   WHEN contract_breach_initiative = 1 THEN 'Alternant'
                   WHEN contract_breach_initiative = 2 THEN 'Entreprise'
                   WHEN contract_breach_initiative = 3 THEN 'Les deux'
               END AS breach_initiative,
               CASE
                   WHEN contract_breach_leave_training = 1 THEN 'Réorientation sur un autre parcours'
                   WHEN contract_breach_leave_training = 4 THEN 'Finalisation hors contrat d''alternance '
                   WHEN contract_breach_leave_training = 2 THEN 'Autre'
               END AS leave_training,
               CASE
                   WHEN contract_breach_pattern = 1 THEN 'En recherche d''un nouveau contrat'
                   WHEN contract_breach_pattern = 2 THEN 'Nouveau contrat en cours de signature'
                   WHEN contract_breach_pattern = 3 THEN 'Obtention du diplôme'
                   WHEN contract_breach_pattern = 5 THEN 'Décision en attente'
                   WHEN contract_breach_pattern = 6 THEN 'Nouveau contrat signé'
               END AS breach_pattern,
               contract_breach_comment_company AS breach_comment_company,
               status_contract_before_breach,
               breach_declaration_at,
               breach_validation_at
        FROM staging.registration r
        LEFT JOIN staging.opco_address oa ON oa.id = r.opco_address_id
        LEFT JOIN staging.opco o ON o.id = oa.opco_id
        LEFT JOIN dwh.contract AS c ON c.registration_id = r.id
        WHERE c.status IN ('rupture',
                         'rupture_pending',
                         'rupture_partielle',
                         'abandon')
        ON CONFLICT (id) DO UPDATE
        SET contract_id = EXCLUDED.contract_id,
            status = EXCLUDED.status,
            breach_date = EXCLUDED.breach_date,
            breach_type = EXCLUDED.breach_type,
            breach_comment = EXCLUDED.breach_comment,
            breach_status = EXCLUDED.breach_status,
            training_dropped = EXCLUDED.training_dropped,
            resignation_date = EXCLUDED.resignation_date,
            breach_initiative = EXCLUDED.breach_initiative,
            leave_training = EXCLUDED.leave_training,
            breach_pattern = EXCLUDED.breach_pattern,
            breach_comment_company = EXCLUDED.breach_comment_company,
            status_contract_before_breach = EXCLUDED.status_contract_before_breach,
            breach_declaration_at = EXCLUDED.breach_declaration_at,
            breach_validation_at = EXCLUDED.breach_validation_at
        WHERE dwh.breach.status IS DISTINCT FROM EXCLUDED.status
           OR dwh.breach.breach_date IS DISTINCT FROM EXCLUDED.breach_date
           OR dwh.breach.breach_type IS DISTINCT FROM EXCLUDED.breach_type
           OR dwh.breach.breach_comment IS DISTINCT FROM EXCLUDED.breach_comment
           OR dwh.breach.breach_status IS DISTINCT FROM EXCLUDED.breach_status
           OR dwh.breach.training_dropped IS DISTINCT FROM EXCLUDED.training_dropped
           OR dwh.breach.resignation_date IS DISTINCT FROM EXCLUDED.resignation_date
           OR dwh.breach.breach_initiative IS DISTINCT FROM EXCLUDED.breach_initiative
           OR dwh.breach.leave_training IS DISTINCT FROM EXCLUDED.leave_training
           OR dwh.breach.breach_pattern IS DISTINCT FROM EXCLUDED.breach_pattern
           OR dwh.breach.breach_comment_company IS DISTINCT FROM EXCLUDED.breach_comment_company
           OR dwh.breach.status_contract_before_breach IS DISTINCT FROM EXCLUDED.status_contract_before_breach
           OR dwh.breach.breach_declaration_at IS DISTINCT FROM EXCLUDED.breach_declaration_at
           OR dwh.breach.breach_validation_at IS DISTINCT FROM EXCLUDED.breach_validation_at;
        GET DIAGNOSTICS v_rows_affected = ROW_COUNT;
        v_total_rows := v_total_rows + v_rows_affected;
        RAISE NOTICE 'Ruptures insérées/mises à jour: %', v_rows_affected;

        -- =====================================================
        -- FIN DE LA PROCEDURE
        -- =====================================================

        -- La transaction est automatiquement validée à la fin de la procédure
        -- Pas besoin de COMMIT explicite

        v_end_time := clock_timestamp();
        v_duration := v_end_time - v_start_time;

        RAISE NOTICE 'Procédure terminée avec succès!';
        RAISE NOTICE 'Durée d''exécution: %', v_duration;
        RAISE NOTICE 'Total de lignes insérées: %', v_total_rows;
        RAISE NOTICE 'Fin à: %', v_end_time;

    EXCEPTION
        WHEN OTHERS THEN
            -- En cas d'erreur, on récupère le message et on le logue
            GET STACKED DIAGNOSTICS v_error_message = MESSAGE_TEXT;

            -- La transaction est automatiquement annulée en cas d'exception
            -- Pas besoin de ROLLBACK explicite

            v_end_time := clock_timestamp();
            v_duration := v_end_time - v_start_time;

            RAISE EXCEPTION 'Erreur dans la procédure d''insertion DWH après % (% lignes insérées): %',
                v_duration, v_total_rows, v_error_message;
    END;
END;
$$;


