--
-- Name: PROCEDURE proc_insert_dwh(); Type: COMMENT; Schema: staging; Owner: postgres
--

COMMENT ON PROCEDURE staging.proc_insert_dwh() IS 'Procédure d''insertion complète dans le data warehouse.
Insère toutes les données depuis les tables staging vers les tables dwh
en respectant l''ordre des dépendances et en gérant les erreurs.
Gère automatiquement les conflits de clés primaires (ON CONFLICT DO UPDATE).
S''exécute dans une transaction implicite de PostgreSQL pour garantir l''atomicité et la cohérence des données.
Utilise les ID existants pour les tables contract et breach afin d''éviter les DELETE.
Fournit un rapport détaillé de l''exécution avec le nombre de lignes insérées
et la durée d''exécution.';


