CREATE TABLE dwh.deadline (
    id integer NOT NULL,
    registration_id integer,
    year integer,
    number integer,
    type integer,
    origin integer,
    status integer,
    date date,
    period_start_date date,
    period_end_date date,
    amount numeric(9,2),
    billable boolean DEFAULT false NOT NULL,
    update_deadline boolean DEFAULT false NOT NULL,
    deleted_at timestamp without time zone,
    funder_type integer,
    reference character varying(255),
    handicap_amount numeric(9,2),
    registration_amount numeric(9,2),
    reference_opco character varying(255),
    opco_period_start_date date,
    opco_period_end_date date,
    secondary_type integer,
    amount_paid_opco numeric(9,2),
    generate_billing character varying(25) NOT NULL,
    updated_at timestamp without time zone DEFAULT now(),
    CONSTRAINT chk_deadline_amounts CHECK ((((amount IS NULL) OR (amount >= (0)::numeric)) AND ((handicap_amount IS NULL) OR (handicap_amount >= (0)::numeric)) AND ((registration_amount IS NULL) OR (registration_amount >= (0)::numeric)) AND ((amount_paid_opco IS NULL) OR (amount_paid_opco >= (0)::numeric)))),
    CONSTRAINT chk_deadline_dates CHECK ((((period_start_date IS NULL) OR (period_end_date IS NULL) OR (period_start_date <= period_end_date)) AND ((opco_period_start_date IS NULL) OR (opco_period_end_date IS NULL) OR (opco_period_start_date <= opco_period_end_date)))),
    CONSTRAINT chk_deadline_generate_billing_not_empty CHECK ((TRIM(BOTH FROM generate_billing) <> ''::text)),
    CONSTRAINT chk_deadline_year_number CHECK ((((year IS NULL) OR (year > 1900)) AND ((number IS NULL) OR (number > 0))))
);


ALTER TABLE dwh.deadline OWNER TO postgres;

